;; @@
(defn plot-radius-dist [[id author]]
  (let [dat {:values (map incntr/log (remove #{0} (temporal-radius id t0 tmax :distribution)))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :values]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.5 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "Minutes"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Temporal radius distribution of " (element-name author))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;serene-fern/plot-radius-dist</span>","value":"#'serene-fern/plot-radius-dist"}
;; <=

;; @@
#_(for [b broadcasters]
  (plot-radius-dist b))
;; @@

;; **
;;; ## Evolutions
;; **

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (temporal-radius id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Degree"]
         [:theme_bw]
         [:ggtitle "Average temporal radius evolution"])]
      {:width 5 :height 5}))
;; @@
